        <div className="relative w-1/4 mt-14 z-20 rounded-xl mx-auto flex justify-center flex-col h-fit bg-sky-900">
            <img className="h-32 w-32" src={current_user.ok ? "https://cdn-icons-png.flaticon.com/512/3135/3135715.png" : "https://cdn-icons-png.flaticon.com/512/2458/2458293.png"}/>
            <h2 className="text-center text-xl italic text-emerald-500">Preferences:</h2>
            <p className="italic text-emerald-500 text-center mb-6">sign up to unlock</p>
        </div>
    )
}
